import{_ as e,c as t,o as s,am as l}from"./chunks/framework.Cl52jaxg.js";const g=JSON.parse('{"title":"无法启动","description":"这里总结了可能遇到的问题以及解决方案。","frontmatter":{"title":"无法启动","description":"这里总结了可能遇到的问题以及解决方案。","layout":"doc"},"headers":[],"relativePath":"version/v2/docs/bug/Unable-start.md","filePath":"version/v2/docs/bug/Unable-start.md"}'),r={name:"version/v2/docs/bug/Unable-start.md"};function i(d,a,m,o,n,c){return s(),t("div",null,[...a[0]||(a[0]=[l('<h1 id="无法启动" tabindex="-1">无法启动 <a class="header-anchor" href="#无法启动" aria-label="Permalink to “无法启动”">​</a></h1><p>这里总结了可能遇到的问题以及解决方案。</p><h2 id="_1-webview2-丢失" tabindex="-1">1.WebView2 丢失 <a class="header-anchor" href="#_1-webview2-丢失" aria-label="Permalink to “1.WebView2 丢失”">​</a></h2><p>如果你在出现了下面这张图中的内容， <img src="https://tc.ets2la.cn/d/img/25-12/20251213195744330.png" alt="" loading="lazy"></p><details class="details custom-block"><summary>原因</summary><p>因为系统缺少Microsoft Edge WebView2 Runtime组件导致的，ETS2LA使用WebView2来渲染界面，如果没有这个组件的话就会出现上图中的内容</p></details><details class="details custom-block"><summary>办法</summary><p>从<a href="https://developer.microsoft.com/zh-cn/microsoft-edge/webview2/?form=MA13LH#download" target="_blank" rel="noreferrer">Microsoft Edge WebView2</a>下载页面下载并安装WebView2 Runtime组件，然后重启ETS2LA即可 <img src="https://tc.ets2la.cn/d/img/25-12/20251213195846097.png" alt="" loading="lazy"></p></details><h2 id="_2-ffmpeg下载失败" tabindex="-1">2.ffmpeg下载失败 <a class="header-anchor" href="#_2-ffmpeg下载失败" aria-label="Permalink to “2.ffmpeg下载失败”">​</a></h2><p>如果你在安装完成之后勾选了打开ETS2LA的话你有很大概率会在控制台中看到下面这张图中的内容，这时不要紧张和害怕，有解决办法的 <img src="https://tc.ets2la.cn/d/img/25-12/20251213200230431.png" alt="" loading="lazy"> 原因：因为FFmpeg是从<a href="./www.gyan.dev.html">www.gyan.dev</a>位于国外的服务器上下载，加上<a href="./www.gyan.dev.html">www.gyan.dev</a>到国内的网络连接不稳定、经常中断，导致下载失败，因此你才会在ETS2LA的控制台中看到报错信息。</p><details class="details custom-block"><summary>原因</summary><p>因为FFmpeg是从<a href="./www.gyan.dev.html">www.gyan.dev</a>位于国外的服务器上下载，加上<a href="./www.gyan.dev.html">www.gyan.dev</a>到国内的网络连接不稳定、经常中断，导致下载失败，因此你才会在ETS2LA的控制台中看到报错信息。</p></details><details class="details custom-block"><summary>办法</summary><p>从<a href="https://download.ets2la.cn/s/K4kHPS" target="_blank" rel="noreferrer">国内镜像站</a>下载ffmpeg，然后放到ETS2LA的安装目录下，然后重启ETS2LA即可</p></details><h2 id="_3-插件无法加载" tabindex="-1">3.插件无法加载 <a class="header-anchor" href="#_3-插件无法加载" aria-label="Permalink to “3.插件无法加载”">​</a></h2><p><img src="https://tc.ets2la.cn/d/img/25-12/20251213201259982.png" alt="" loading="lazy"></p><details class="details custom-block"><summary>原因</summary><p>插件加载失败通常是由于系统资源不足或启动过程中的时序问题导致的。</p></details><details class="details custom-block"><summary>办法</summary><p>在 设置-全局设置-变量 中勾选上 缓慢启动，如已勾选上 缓慢启动 后仍然无法加载插件，请设置 32~64GB 的虚拟内存</p></details>',14)])])}const h=e(r,[["render",i]]);export{g as __pageData,h as default};
